import React from "react";
import { useForm } from "react-hook-form";
import "./FormSignup.css";

const FormSignup = () => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const onSubmit = (values) => console.log(values);

  return (
    <div>
      <form onSubmit={handleSubmit(onSubmit)}>
        <h1>Napravite nalog!!!!!!!</h1>
        <br />

        <div>
          <label htmlFor="email">Email adresa</label>
          <br />
          <input
            className="py-2 px-4 border rounded-lg text-sm"
            type="email"
            {...register("email", {
              required: "Required",
              pattern: {
                value: /^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i,
                message: "invalid email address",
              },
            })}
            name="email"
            placeholder="Unesite email"
            id="email"
          />
          {errors.email && errors.email.message}
        </div>

        <div>
          <label htmlFor="firstName">Ime</label>
          <br />
          <input
            type="text"
            {...register("firstName", {
              required: "Required",
            })}
            name="firstName"
            placeholder="Unesite ime"
            id="firstName"
          />
          {errors.firstName && errors.firstName.message}
        </div>

        <div>
          <label htmlFor="lastName">Prezime</label>
          <br />
          <input
            type="text"
            {...register("lastName", {
              required: "Required",
            })}
            name="lastName"
            placeholder="Unesite prezime"
            id="lastName"
          />
          {errors.lastName && errors.lastName.message}
        </div>

        <div>
          <label htmlFor="password">Lozinka</label>
          <br />
          <input
            type="password"
            {...register("password", {
              required: "Required",
              minLength: { value: 10, message: "TOO SHORT" },
            })}
            name="password"
            placeholder="Unesite password"
            id="password"
          />
          {errors.password && errors.password.message}
        </div>

        <div>
          <label htmlFor="password2">Potvrdite lozinku</label>
          <br />
          <input
            type="password"
            {...register("password2", {
              required: "Required",
            })}
            name="password2"
            placeholder="Potvrdite password"
            id="password2"
          />
          {errors.password2 && errors.password2.message}
        </div>

        <div>
          <label htmlFor="date">Datum rođenja</label>
          <br />
          <input
            type="date"
            {...register("date", {
              required: "Required",
            })}
            name="date"
            placeholder="Potvrdite password"
            id="date"
          />
          {errors.date && errors.date.message}
        </div>

        <button type="submit">Registruj se</button>
      </form>

      <p>Vec imate nalog?</p>
      <button>Ulogujte se</button>
    </div>
  );
};

export default FormSignup;
